

# 392. Is Subsequence

# Given a string s and a string t, check if s is subsequence of t.

# You may assume that there is only lower case English letters in both s and t.
# t is potentially a very long (length ~= 500,000) string, and s is a short string (<=100).

# A subsequence of a string is a new string which is formed from the original string
# by deleting some (can be none) of the characters without disturbing the relative positions of the remaining characters.
# (ie, "ace" is a subsequence of "abcde" while "aec" is not).

# Example 1:
# s = "abc", t = "ahbgdc"

# Return true.

# Example 2:
# s = "axc", t = "ahbgdc"

# Return false.


class isSubsequence(object):
    def doit(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        t1 = 0
        for c in s:
    
            t1 = t.find(c, t1)
            if t1 == -1:
                break

            t1 = t1 + 1

        return t1 != -1


    def doit(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        t = iter(s)
        return all( c in t for c in s)


    def doit(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        s1, t1 = 0, 0
        while s1 < len(s) and t1 < len(t):

            if s[s1] == t[t1]:
                s1 += 1
            
            t1 += 1

        return s1 == len(s)
            


    def doit(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        t1 = -1
        for c in s:

            t1 = t1 + 1

            while t1 < len(t) and t[t1] != c:
                t1 += 1
 
            if t1 == len(t):
                break

            

        return t1 != len(t)

if __name__ == "__main__":

    res = isSubsequence().doit("abc", "ahbgdc")

    res = isSubsequence().doit("acb", "ahbgdc")

